private static boolean isLocalhostConflict(String addr1, String addr2) {
    if(isLocalhost_IPv4(addr1) && isLocalhost_IPv4(addr2)) {
        return parseLocalhost_IPv4(addr1).equals(parseLocalhost_IPv4(addr2));
    }
    if(isLocalhost_IPv6(addr1) && isLocalhost_IPv6(addr2)) {
        return parseLocalhost_IPv6(addr1).equals(parseLocalhost_IPv6(addr2));
    }
    return false;
}

private static boolean isLocalhost_IPv4(String addr) {
    return addr.startsWith("localhost:") || addr.startsWith("127.0.0.1:") || addr.startsWith(":");
}

private static boolean isLocalhost_IPv6(String addr) {
    return addr.startsWith("[::1]:") || addr.startsWith("[0:0:0:0:0:0:0:1]:");
}

private static String parseLocalhost_IPv4(String addr) {
    if(addr.startsWith("localhost:"))   return addr.replaceFirst("localhost:", "127.0.0.1:");
    if(addr.startsWith(":"))            return addr.replaceFirst(":", "127.0.0.1:");
                                        return addr;
}

private static String parseLocalhost_IPv6(String addr) {
    if(addr.startsWith("[::1]:"))       return addr.replaceFirst("\\[::1\\]:", "[0:0:0:0:0:0:0:1]:");
                                        return addr;
}

private static boolean isConflict_0000_IPv4OrIPv6(String addr1, String addr2, boolean isRecursion) { //default false
    if(addr1.startsWith("0.0.0.0:")) {
        if(addr1.replaceFirst("0.0.0.0:", "").equals(getPort(addr2))) {
            return true;
        }
    } 
    if(addr1.startsWith("[::]:")) {
        if(addr1.replaceFirst("\\[::\\]:", "").equals(getPort(addr2))) {
            return true;
        }
    }
    return !isRecursion ? isConflict_0000_IPv4OrIPv6(addr2, addr1, true) : false;
}

private static String getPort(String addr) {
    return addr.substring(addr.lastIndexOf(":") + 1);
}

private static String tryDecodeSnmp4jAddress(String address) {
    final String prefix = "udp:";
    if (address != null && address.toLowerCase().startsWith(prefix)) {
        address = address.substring(prefix.length()).replace("/", ":").trim();
    }
    return address;
}

